import React from "react";

import './Input.css';

type TInputProps = {
  type?: 'text'
  value: string,
  placeholder: string,
  onChange: (event: React.ChangeEvent<HTMLInputElement> | undefined, value: string) => void,
  onKeyDown?: () => void;

}

export const Input: React.FC<TInputProps> = ({ 
  placeholder,
  value,
  onChange,
  type='text',
  onKeyDown,
}) => {

    return (
        <div>
            <input
              type={type}
              className="input"
              placeholder={placeholder}
              value={value}
              onChange={onChange}
              onKeyDown={onKeyDown}
            />
        </div>
    );
}
